import React from "react";
import * as W from "../styles/styledWrite";
import { useNavigate } from "react-router-dom";

export function Write() {
  const navigate = useNavigate();

  const goWrite = () => {
    navigate(`/write`);
  };

  return (
    <>
      <W.Container>
        <W.TopBar>
          <W.BackBtn />
          <W.GroupSmall>
            <img src="/images/GroupSmall.svg" alt="GroupSmall" />
          </W.GroupSmall>
          <W.MyPage />
        </W.TopBar>
        <W.ProfileContainer>
          <W.UserInput
            type="text"
            placeholder="포에버리즘 : 우리의 세상의 끝으로"
          ></W.UserInput>
        </W.ProfileContainer>
        <W.BigContainer>
          <W.InformationInput
            type="text"
            placeholder="작품 이름 혹은 번호(필수아님)"
          ></W.InformationInput>
          <W.ButtonContainer>
            <W.Buttonimg>
              <img src="/images/Plus.svg" alt="Plus" />
            </W.Buttonimg>
          </W.ButtonContainer>
        </W.BigContainer>
      </W.Container>
    </>
  );
}
